Auflösung 
§ 35. (1) Die Privatstiftung wird aufgelöst, sobald 
 1. die in der Stiftungserklärung vorgesehene Dauer abgelaufen ist; 
 2. über das Vermögen der Privatstiftung das Konkursverfahren eröffnet worden ist; 
 3. der  Beschluss  über  die  Nichteröffnung  eines  Insolvenzverfahrens  mangels  kostendeckenden 
Vermögens Rechtskraft erlangt hat;

3. der  Beschluss  über  die  Nichteröffnung  eines  Insolvenzverfahrens  mangels  kostendeckenden 
